import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import SearchIcon from '@mui/icons-material/Search';
const SearchIngine = () => {
  const [query, setQuery] = useState('');
  const navigate = useNavigate();

  const handleSearch = (e) => {
    e.preventDefault();
    if (query.trim()) {
      navigate(`/search?query=${query.trim()}`);
    }
  };

  return (
    <div className="searchproduct" style={{height:''}}>
    <form onSubmit={handleSearch}>
      <input
        type="text"
        placeholder="Search for products..."
        value={query}
        onChange={(e) => setQuery(e.target.value)}
        style={{ marginBottom: '10px', padding: '15px', height: '', width: '400px', marginTop: '-10px', borderRadius: '120px', backgroundColor: 'rgb(212,214,218)', outline: 'none', border: 'none',letterSpacing:'2px' }}
      />
      <button type="submit" style={{border:'none',background:'none'}}><SearchIcon className="" style={{color:'black',fontSize:''}}/></button>
    </form>
    </div>
  );
};

export default SearchIngine;
